import React from 'react';
import { Link } from 'react-router-dom';

const Service = (props) => {
    const {img,id,name,price,time,description}=props.services;
    return (
       
            
        
<div>
<div className='service pb-3 m-3 p-3 ' >
        
        <img src={img} alt="" width='300px' height='250px'/>
        <h2>id:{id}</h2>
        <h2>Name:{name}</h2>
        <h2>price:{price}</h2>
        <p>Description:{description}</p>
        
        
        <Link to={`/booking/${description} ${id}`}>
        <button className='btn-primary'>Book:{name.toLowerCase()}</button>
        </Link>
        
    </div>
   
</div>
        
    );
};

export default Service;
